	add("bough", "{\"term\":\"bough\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Persian\", \"ancient greek (to 1453)\", \"Sanskrit\", \"classical armenian\"], \"text\":\"Middle english (1100-1500) from Old english (ca. 450-1100) {{m|ang|bōg||shoulder, bough}}, from Proto-germanic {{m|gem-pro|*bōguz||upper arm, shoulder}} (compare German \u0027bug\u0027 (shoulder, hock, joint) , from Proto-indo-european {{m|ine-pro|*bʰāǵʰus||forearm, elbow}} (compare Ancient greek (to 1453) \u0027πῆχυς\u0027 (forearm) Classical armenian \u0027բազուկ\u0027 (arm, forearm, bough) Persian \u0027بازو\u0027 (upper arm) Sanskrit \u0027बाहु\u0027 (arm) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A firm branch of a tree\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dNow we plunged into a deep shade with the \u0027\u0027boughs\u0027\u0027 lacing each other overhead, and crossed dainty, rustic bridges over the cold trout-streams, the boards giving back the clatter of our horses\u0027 feet: or anon we shot into a clearing, with a colored glimpse of the lake and its curving shore far below us\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, w:J. M. J. M. Coetzee, \u0027w:The Childhood of The Childhood of Jesus\u0027. Melbourne, Australia: The Text Publishing Company. chapter 18. p. 172\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A pair of birds settle on the \u0027\u0027bough\u0027\u0027 above them, murmuring together, ready to roost\", \"priority\":4}]}, \"synonyms\":{}}");

