	add("boundary", "{\"term\":\"boundary\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) from Latin\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The dividing line or location between two areas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"So this was my future home, I thought!Backed by towering hills, the but faintly discernible purple line of the French \u0027\u0027boundary\u0027\u0027 off to the southwest, a sky of palest Gobelin flecked with fat, fleecy little clouds, it in truth looked a dear little city; the city of one\u0027s dreams\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An edge or line marking an edge of the playing field\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An event whereby the ball is struck and either touches or passes over a boundary (with or without bouncing), usually resulting in an award of 4 (a four) or 6 (a six) runs respectively for the batting team\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The set of points in the closure of a set \u0026lt;math\u0026gt;S\u0026lt;/math\u0026gt;, not belonging to the interior of that set\", \"priority\":5}]}, \"synonyms\":{}}");

