	add("bourbon", "{\"term\":\"bourbon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"The French w:Bourbon dynasty|Bourbon dynasty is named for the lordship of French \u0027Bourbon l\u0027Archambault\u0027. The town\u0027s name derives from Gaulish w:Borvo|Borvo, a local Celtic deity associated with hot springs, from Proto-celtic {{m|cel-pro|*borvo||froth, foam}}. The subsidiary senses derive from the dynasty\u0027s name.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a European w:Bourbon dynasty which reigns in Spain and formerly ruled the Kingdom of France\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:Bourbon County, Bourbon County, Kentucky, in the United States\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"w:Bourbon Bourbon Street in New Orleans, Louisiana, in the United States\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The island of Réunion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A town in Indiana\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A city in Missouri\", \"priority\":6}]}, \"synonyms\":{}}");

