	add("boustrophedon", "{\"term\":\"boustrophedon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027βουστροφηδόν\u0027 from \u0027βοῦς\u0027 (ox) + \u0027στροφή\u0027 (turning) + \u0027-δον\u0027 (adverbial suffix)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Writing that is right-to-left and left-to-right on alternate lines\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Leslie Threatte, \u0027The Grammar of Attic Inscriptions: Phonology\u0027, [http://books.google.com.au/books?id\u003dgTJnU8O-fs0C\u0026amp;pg\u003dPA55\u0026amp;dq\u003d%22boustrophedon%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d4nRXU8f2CMytkgWVuICACA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22boustrophedon%22\u0026amp;f\u003dfalse page 55\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The number of Attic \u0027\u0027boustrophedon\u0027\u0027 texts is fairly small; most of those just cited have been brought down by the experts to a date close to 550 B.C., a date to which several texts of more than one line inscribed left to right may also be assigned (cf. pp.56—57 infra), besides the four-line retrograde sep. mon. of Pediarchus cited in the previous section (cf. p.52 supra). Stone texts only really become numerous in Attica about 550, and by this time it is clear that left-to-right writing is just as common as \u0027\u0027boustrophedon\u0027\u0027, and may have been so even earlier.After 540 \u0027\u0027boustrophedon\u0027\u0027 was certainly unusual\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Richard Sproat, \u0027A Computational Theory of Writing Systems\u0027, [http://books.google.com.au/books?id\u003dB8iB74qClQcC\u0026amp;pg\u003dPA61\u0026amp;dq\u003d%22boustrophedon%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d4nRXU8f2CMytkgWVuICACA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22boustrophedon%22\u0026amp;f\u003dfalse page 61\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Venetic apparently had both kinds of \u0027\u0027boustrophedon\u0027\u0027, either flipping the face of the characters when switching direction or else inverting them (Lejeune, 1974, pages 180-181\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Elmer H. Antonsen, \u0027Runes and Germanic Linguistics\u0027, [http://books.google.com.au/books?id\u003dgvSi3JVNRFQC\u0026amp;pg\u003dPA132\u0026amp;dq\u003d%22boustrophedon%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d4nRXU8f2CMytkgWVuICACA\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22boustrophedon%22\u0026amp;f\u003dfalse page 132\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He draws a sharp distinction between true \u0027\u0027boustrophedon\u0027\u0027, which has the tops of the runes pointed in the same direction, but with a change in the direction of writing with each line, and false \u0027\u0027boustrophedon\u0027\u0027, which changes from upright to inverted runes with each line, but the lines themselves are each written in the same direction\", \"priority\":10}]}, \"synonyms\":{}}");

